                attribution: 'Map tiles by Carto, under CC BY 3.0. Data by OpenStreetMap, under ODbL.',
                maxZoom: 18
            }).addTo(map);
            var markers = L.markerClusterGroup();
            var locations = [
                [${df6['latitude'].values[0]}, ${df6['longitude'].values[0]}],
